        { name: 'Tablets', image: 'tablet.jpg' },
        { name: 'Others', image: 'others.jpg' },
    ];

    const handleClick = (item) => {
        navigate(`/dispose/${item.name.replace(/\s+/g, '-').toLowerCase()}`); // Adjust route path
